import React, { Component } from 'react';
import NavBar from './components/NavBar';
import Counters from './components/Counters';

class App extends Component {
    render() { 
        return ( 
            <React.Fragment>
                <NavBar />
                <main className="container">
                    <Counters />
                </main>
            </React.Fragment>    
        );  
    }

}

export default App;
